    true,nt"url": null,nt"notes": "<p>The Medicare Geographic Variation Public
    Use File provides the ability to view demographic, utilization and quality indicators
    at the state level (including Washington DC, Puerto Rico, and Virgin Islands), and
    at the Hospital Referral Region (HRR) level. This aggregated program data enables
    researchers and policymakers to evaluate geographic variation in the utilization
    and quality of health care services for the Medicare Fee for Service population.</p>n",nt"license_title":
